  false,\n\t\"url\": null,\n\t\"notes\": \"The Department of Taxation and Finance
  (the Department) annually publishes statistical information on the New York State
  earned income tax credit (EITC). This includes data on the separate New York City
  EITC and the New York State noncustodial parent EITC. Summary data are presented
  for all taxpayers which includes full-year New York state residents, part-year residents
  and nonresidents (where applicable). Data are shown for the total number of claimants
  and credit claimed by county and/or region for all filing statuses.\",\n\t\"license_title\":
